import "../styles/Flat.css"

class Flat extends React.Component {

    render() {
        return <div className="flat">
            <img className="flat__image" src={this.props.source} alt=""/>
            <p className="flat__title">{this.props.titre}</p>
        </div>
    }
}

export default Flat
